// RESUME JS
// ---------------------------------------------------------------------------

import { Document, Page } from 'react-pdf'
import file from './kenneth-petiote.pdf';
// import "./style.css";

export default function Resume() {
  return (
    <Document file={file}>
      <Page pageNumber={1} />
    </Document>
  );
}
